import React from 'react';
import '../../styles/App.css';

class DJing extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div className="projectBody">
                <h2>DJing / Controller Performance</h2>
                <p>
                    In spring 2021, I took a class on Electronic Performance, in which I learned how to use MIDI controllers to create looping-based performances!
                </p>

                <br/>

                <iframe width="560" height="315" src="https://www.youtube.com/embed/videoseries?list=PLKgcPfLvshU7mDs6wxM20UauM7nCUb5gT" frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
            </div>
        );
    }
}

export default DJing;
